# parameters
min_time = dt.datetime(2016, 8, 29)
end_time = dt.datetime(2016, 9, 6, 0, 30, 0)
nbr_of_teams = 101
top8_bebfore_leak = lb[lb.SubmissionDate <= '2016-09-02 09:00:00'].groupby('TeamName').min()[['Score']].sort_values('Score').index[:20]
teams_to_plot_journey = top8_bebfore_leak
#teams_to_plot_journey = list(lb.groupby('TeamName').min()[['Score']].sort_values(by='Score').index[:9])
# predefined colors
team_colors = ['#000000', '#800000', '#FF0000', '#FFFF00', '#00FFFF', '#FF00FF', '#800080', '#0000FF', '#347C2C', '#FFFFFF','#000000', '#800000', '#FF0000', '#FFFF00', '#00FFFF', '#FF00FF', '#800080', '#0000FF', '#347C2C', '#FFFFFF']


# derive leaderboard ranks for each period
minutes = pd.date_range(min_time, end_time, freq='30Min')[::-1]
surface = np.zeros([len(minutes), nbr_of_teams]) 
line = []
for i, m in enumerate(minutes):
    df = lb[lb.SubmissionDate <= m]
    x = df.groupby('TeamName').min()[['Score']].sort_values('Score')
    surface[i] = np.array(x)[:nbr_of_teams, 0][::-1]
    for team in teams_to_plot_journey:
        team_rank = list(x.index).index(team)
        team_score = x.iloc[team_rank]['Score']
        line.append([i, m, team, team_rank, team_score])

line_df = pd.DataFrame(line, columns = ['time', 'm', 'team', 'rank', 'score'])
X, Y = np.meshgrid(np.arange(nbr_of_teams), np.arange(len(minutes)))

# Create the 3d suface plot
fig = plt.figure()
ax = fig.add_subplot(1, 1, 1, projection='3d')
surf = ax.plot_surface(X, Y, surface, rstride=1, cstride=1, cmap=plt.cm.Greys,
                       linewidth=0, antialiased=False, alpha=0.8, vmin=2.1, vmax=2.3)
fig.colorbar(surf, shrink=0.5, aspect=10)
for i, team in enumerate(teams_to_plot_journey):
    team_journey = line_df[line_df['team'] == team]
    team_journey = team_journey.sort_values(by='time', ascending=False)
    team_color = team_colors[i]
    team_final_rank = int(team_journey['rank'].iloc[-1]) + 1
    line, = ax.plot(nbr_of_teams - team_journey['rank'].values - 1, team_journey['time'].values, team_journey['score'].values, 
                    color=team_color, linewidth=2.5, label= '%i. %s' % (team_final_rank, team), alpha=0.8)

#Labeling & Legends
ax.set_xlabel('Public LB Rank')
xs = np.arange(0, nbr_of_teams, 20)
ax.set_xticks(xs)
ax.set_xticklabels(xs)
ax.set_xticklabels(nbr_of_teams - xs)
ax.set_xlim(0, nbr_of_teams)

#ax.set_ylabel('Time <-')
yt = np.arange(0, len(minutes), len(minutes)//20 )
yl = [minutes[t].strftime('%Y-%m-%d %H') for t in yt]
ax.set_yticks(yt)
ax.set_yticklabels(yl, ha='left')
ax.set_zlabel('mlogloss')

plt.legend(loc='upper left')
